function SearchVideo(){$.ajax("https://www.googleapis.com/youtube/v3/search?q="+$("#SearchQuery").val()+"&part=snippet&type=video&maxResults=25&key=AIzaSyDLd-4mlOr7Ql1v2KZftgNNdoj-dRc6Fog").done(n=>{$("#SearchResults").html(""),n.items.forEach(n=>{$("#SearchResults").append('<div class="video"><img src="'+n.snippet.thumbnails.high.url+'" /><h1>'+n.snippet.title+"<\/h1><\/div>").click(()=>ChooseVideo(n.id.videoId))})})}function ChooseVideo(n){$("[name=YoutubeVideo]").val(n);$("#VideoSearch")[0].close()}$("#video").click(()=>{$("#VideoSearch")[0].showModal()});let Timeout;$("#SearchQuery").keydown(()=>{Timeout&&clearTimeout(Timeout),Timeout=setTimeout(SearchVideo,500)});